import React from 'react';
import { Container, Grid, Drawer, List, ListItem, ListItemIcon, ListItemText } from '@mui/material';
import { Home, Inbox, Mail, LiveTv, ViewComfy, Timeline, MoreHoriz } from '@mui/icons-material';
import './App.css'; 
import {logo} from './assets/secura.png';

const App = () => {
  const pageStyles = {
    backgroundColor: '#111115',
    minHeight: '100vh',
    display: 'flex',
  };

  const sidebarStyles = {
    backgroundColor: '#151515',
    width: '8vw',
    padding: '16px',
    minHeight: '100vh',
    marginLeft: '-130px',
  };

  const listItemStyles = {
    display: 'flex',
    alignItems: 'center',
    marginBottom: '12px',
  };

  const logoStyles = {
    display: 'flex',
    alignItems: 'center',
    marginBottom: '20px',
  };

  const secondSidebarStyles = {
    backgroundColor: '#0D0D0F',
    width: '15vw',
    padding: '16px',
    minHeight: '100vh',
    color: 'white',
  };

  // Responsive styles for the sidebar
  const responsiveStyles = {
    '@media (max-width: 768px)': {
      sidebarStyles: {
        width: '25vw', // Adjust the width for smaller screens
      },
      secondSidebarStyles: {
        width: '20vw', // Adjust the width for smaller screens
      },
    },
  };

  return (
    <div style={pageStyles}>
      <Container>
        <Grid container>
          <Grid sx={{ ...sidebarStyles, ...responsiveStyles.sidebarStyles }}>
            <div style={logoStyles}>
              <img src={logo} alt="Logo" />
            </div>
            <List>
              <ListItem button sx={listItemStyles}>
                <ListItemIcon sx={{ color: 'white', marginLeft: '10px' }}>
                  <Home />
                </ListItemIcon>
              </ListItem>
              <ListItem button sx={listItemStyles}>
                <ListItemIcon sx={{ color: 'white', marginLeft: '10px' }}>
                  <Inbox />
                </ListItemIcon>
              </ListItem>
              <ListItem button sx={listItemStyles}>
                <ListItemIcon sx={{ color: 'white', marginLeft: '10px' }}>
                  <Mail />
                </ListItemIcon>
              </ListItem>
            </List>
          </Grid>
          <Grid sx={{ ...secondSidebarStyles, ...responsiveStyles.secondSidebarStyles }}>
            <List>
              <ListItem button sx={listItemStyles}>
                <ListItemIcon sx={{ color: 'white', marginLeft: '10px' }}>
                  <LiveTv />
                </ListItemIcon>
                <ListItemText primary="Live" />
              </ListItem>
              <ListItem button sx={listItemStyles}>
                <ListItemIcon sx={{ color: 'white', marginLeft: '10px' }}>
                  <ViewComfy />
                </ListItemIcon>
                <ListItemText primary="Layout" />
              </ListItem>
              <ListItem button sx={listItemStyles}>
                <ListItemIcon sx={{ color: 'white', marginLeft: '10px' }}>
                  <Timeline />
                </ListItemIcon>
                <ListItemText primary="Sequence" />
              </ListItem>
              <ListItem button sx={listItemStyles}>
                <ListItemIcon sx={{ color: 'white', marginLeft: '10px' }}>
                  <MoreHoriz />
                </ListItemIcon>
                <ListItemText primary="More" />
              </ListItem>
            </List>
          </Grid>
          <Grid item xs={6}>
            {/* Main content */}
          </Grid>
        </Grid>
      </Container>
    </div>
  );
};

export default App;
